import react,{useState} from 'react'
import {useEffect} from 'react'
import imgdic from '../Data/Imgedata'


const ImgeShow=()=>{

    const [index,setindex]=useState(0)

    useEffect(()=>{
        // let new_index=(index+1)%imgdic.length;
        // let y=setTimeout(()=>{
        //     setindex(new_index);
        // },3000)
        // return (()=>{
        //     clearInterval(y)
        // })

    },index)
  

    return(
    <div className="imgshow_div">
        {
            imgdic.map((img,imgindex)=>{

                const {id,link}=img
                let position='nextclass'
                if(index-1==imgindex || index==imgdic.length && imgindex==0){
                    position="preclass"
                }else if(index==imgindex){
                    position="activeclass"
                }

           
   
                return (
                <img src={link} key={id} className='imgshow' alt="hi"></img>
                 )

            })
        }
    </div>
    )
}

export default ImgeShow;
